import React from "react";
import axios from "axios";


const Test = () => {
    const [question,setQuestion] = useState({});
    const getSample = async()=>{
        try{
            const res = await axios.get('https://www.career.go.kr/inspct/openapi/test/questions?apikey="인증키"dls&q=6')
            setQuestion ({
                question: res.data.RESULT[0].question,
                answer01: res.data.RESULT[0].answer01,
                answer02: res.data.RESULT[0].answer02
            })
        } catch(error){
            console.error(error);
        } 
    }
    useEffect(()=>{getSample()},[])
    return(
        <div>
            <h1>test page</h1>
            <p>{question.question}</p>
            <span>{question.answer01}</span>
            <span>{question.answer02}</span>
        </div>
    )
}

export default Test;
